import React from 'react'

const Quiz = () => {

  var paper = [
    { id: 1, question: 'Are you?', a: 'male', b: 'female', Rating: [20, 10, 10] },

    { id: 2, question: "What type of home do you live", a: 'Mansion (more than 6 bedrooms)', b: 'Detached', c: 'Cottage', d: 'Terrace ( 3 floors)', e: 'Terrace ( 2 floors)', f: 'Bungalow', g: 'Flat (Purpose build)', h: 'Flat (Conversion)', i: 'Town House', j: 'Do you own more that 1 home?' },

    { id: 3, question: "How well is your home insulated", a: 'Very well', b: `It's OK`, c: 'Drafts everywhere', d: `Don't know` },

    { id: 4, question: "How many adults (16+) live in your home", a: 1, b: 2, c: 3, d: 4, e: 5, f: '6+' }

  ];

  console.log(paper);

  return (
    <>
      {paper.map((question) => {
console.log('question',question);
      })}


    </>
  )
}
export default Quiz;
